CREATE DATABASE  IF NOT EXISTS ‘wheretogo’;
USE ‘wheretogo’;

DROP TABLE IF EXISTS ’Cities‘;
CREATE TABLE Cities(
   City_ID    INTEGER  NOT NULL PRIMARY KEY 
  ,city       VARCHAR(21)
  ,city_ascii VARCHAR(21)
  ,lat        NUMERIC(8,4)
  ,lng        NUMERIC(9,4)
  ,country    VARCHAR(24)
  ,iso2       VARCHAR(2)
  ,iso3       VARCHAR(3)
  ,admin_name VARCHAR(32)
  ,capital    VARCHAR(7)
  ,population INTEGER 
);




DROP TABLE IF EXISTS ‘City_Attraction’;
CREATE TABLE City_Attraction(
   CityID          INTEGER  NOT NULL 
  ,Attraction_Type VARCHAR(8) NOT NULL
  ,PRIMARY KEY(CityID, Attraction_Type)
);

DROP TABLE IF EXISTS ‘City_Environment’;
CREATE TABLE City_Environment(
   City_ID      INTEGER  NOT NULL PRIMARY KEY 
  ,Climate_Type VARCHAR(11) NOT NULL
);

DROP TABLE IF EXISTS ‘City_Air_condition’;

CREATE TABLE City_Air_condition(
   City_ID              INTEGER  NOT NULL PRIMARY KEY 
  ,Air_Pollution_Int    INTEGER  NOT NULL
  ,Air_Pollution_String VARCHAR(9) NOT NULL
);

DROP TABLE IF EXISTS ‘City_Food’;

CREATE TABLE City_Food(
   City_ID        INTEGER  NOT NULL PRIMARY KEY 
  ,city           VARCHAR(49) NOT NULL
  ,Recommend_Food VARCHAR(14) NOT NULL
);

DROP TABLE IF EXISTS ‘Accommodations’;
CREATE TABLE Accommodations(
   ID                                                 INTEGER  NOT NULL PRIMARY KEY 
  ,Name                                               VARCHAR(67)
  ,Rate                                               INTEGER  NOT NULL
  ,Type                                               VARCHAR(6) NOT NULL
  ,Price                                              INTEGER  NOT NULL
  ,FREE_WIFI_Availibility                             VARCHAR(3) NOT NULL
  ,FREE_PARKING_Availibity                            VARCHAR(3) NOT NULL
  ,Average_Travel_Time_from_Airport_Train_Station_min INTEGER  NOT NULL
  ,lat                                                NUMERIC(8,4) NOT NULL
  ,lng                                                NUMERIC(9,4) NOT NULL
);

DROP TABLE IF EXISTS ‘Environment’;
CREATE TABLE Environment(
   Climate_Type          VARCHAR(11) NOT NULL PRIMARY KEY
  ,Average_Temperature   INTEGER  NOT NULL
  ,Average_Precipitation INTEGER  NOT NULL
  ,Maximum_Temperature   INTEGER  NOT NULL
  ,Minimum_Temperature   INTEGER  NOT NULL
);

DROP TABLE IF EXISTS ‘Attractions’;
CREATE TABLE Attractions(
   Attraction_Type     VARCHAR(8) NOT NULL PRIMARY KEY
  ,Having_Animals      VARCHAR(5) NOT NULL
  ,Indoor_Attraction   VARCHAR(5) NOT NULL
  ,Cultural_Attraction VARCHAR(5) NOT NULL
);

DROP TABLE IF EXISTS ‘City_Accommodations’;
CREATE TABLE City_Accommodations(
   ID      INTEGER  NOT NULL PRIMARY KEY 
  ,Name    VARCHAR(67)
  ,City_ID INTEGER 
);

DROP TABLE IF EXISTS ‘Food’;

CREATE TABLE Food(
   Cuisine_type       VARCHAR(14) NOT NULL PRIMARY KEY
  ,Calories           VARCHAR(6) NOT NULL
  ,Nonreproducibility VARCHAR(6) NOT NULL
  ,Diversity          VARCHAR(6) NOT NULL
);











